remarks.code:
LicenseInfo _licInfo;
public LicensedControl()
{
  // check license but don't nag yet
  _licInfo = ProviderInfo.Validate(typeof(LicensedControl), this, false);

  // perform licensing after control is fully loaded
  Loaded += LicensedControl_Loaded;
}
void LicensedControl_Loaded(object sender, RoutedEventArgs e)
{
  // nag after loading
  if (_licInfo.ShouldNag)
  {
    ProviderInfo.ShowAboutBox(this);
  }
}

member.example:
The code below handles the  event after theme name was assigned.
As a result, the theme name was assigned to  property, but the theme was not applied on the form due to "e.Handled = true".

var c1ThemePicker1 = new C1ThemePicker();
c1ThemePicker1.ThemeApplying += c1ThemePicker1_ThemeApplying;

c1ThemePicker1.SelectedThemeName = "BeigeOne"; // assign theme name

private void c1ThemePicker1_ThemeApplying(object sender, ThemeApplyingEventArgs e)
{
    var themeName = e.ThemeName; // is "BeigeOne"
    e.Handled = true;            // The theme will not be applied to the form controls
}

The code below in the drop-down list will leave only the names of themes containing "one" and "silver":
'BeigeOne', 'MacSilver', 'Office2007Silver', 'Office2010Silver'.
Also, the string array  will contain the same elements.

var c1ThemePicker1 = new C1ThemePicker();
c1ThemePicker1.Filter = "(one|silver)";
